import React from "react";

const MovieList = (props) => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-sm-12">
          {props.movies.map((movie, i) => {
            return <Movie key={i} />;
          })}
        </div>
      </div>
    </div>
  );
};

export default MovieList;
